import { useEffect } from "react"
import React , {useState} from 'react'



const View = () =>{

    const [data, setData] = useState ()
    useEffect(() => {
        (async function() {
            try {
                const response = await fetch(
                    'http://localhost:3003/users'
                );
                const json = await response.json();
               setData(json)
            //    setLoader(true)
            } catch (e) {
                console.error(e);
            }
        })();
    }, []);

    return(
        <>
        <div className="view-wrapper">
            
        </div>
        </>
    )
}


export default View;
